If you navigate to `/login/<user>` , it will give you a cookie `user=<user>` . If you navigate to `/logout` , it will delete the cookie.

You can check what user you are logged in as with this function:

``` javascript
function getCookie(name) {
    var value = "; " + document.cookie;
    var parts = value.split("; " + name + "=");
    if (parts.length == 2) return parts.pop().split(";").shift();
}
```

Pass `'user'` as `name`.

